import { Routes } from "react-router-dom";
import Navbar from "./components/"



const App = () => {
  return <div>
      <div>
        <Navbar></Navbar>
      </div>
      <Routes>
        <Route path ='/' element={<Home/>} ></Route>
      </Routes>

  </div>;
};

export default App;
